/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `trg_kardex_actualiza_inventario` AFTER INSERT ON `tbl_kardex` FOR EACH ROW BEGIN
    -- Actualizar cantidad
    IF NEW.tipo_movimiento = 'entrada' THEN
        UPDATE tbl_inventario
        SET cantidad = cantidad + NEW.cantidad
        WHERE id_producto = NEW.id_producto;
    ELSEIF NEW.tipo_movimiento = 'salida' THEN
        UPDATE tbl_inventario
        SET cantidad = cantidad - NEW.cantidad
        WHERE id_producto = NEW.id_producto;
    END IF;

    -- Actualizar estado del inventario
    UPDATE tbl_inventario i
    JOIN tbl_productos p ON p.id_producto = i.id_producto
    SET i.estado = CASE
        WHEN i.cantidad < p.cantidad_minima THEN 'bajo'
        WHEN i.cantidad > p.cantidad_maxima THEN 'alto'
        ELSE 'normal'
    END
    WHERE i.id_producto = NEW.id_producto;
END */;;
DELIMITER ;
